[include mainsail.cfg]
[include include/*.cfg]
[include K-ShakeTune/*.cfg]

[mcu]
canbus_uuid: 93a0405919c2

[mcu toolhead]
canbus_uuid: 7e49327ec79f

#Box Turtle 
#7dc7fc838b16

[exclude_object]

[virtual_sdcard]
path: /home/trev/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[printer]
kinematics: corexy
max_velocity: 1000  
max_accel: 20000
max_z_velocity: 40          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
minimum_cruise_ratio: 0.5
square_corner_velocity: 5.0

[extruder]
nozzle_diameter: 0.400

[input_shaper]
shaper_type_x = mzv
shaper_freq_x = 55.4
shaper_type_y = mzv
shaper_freq_y = 40.0

[include AFC/*.cfg]

